import React from 'react'
import LogoImg from '../../../assets/defaultImg/logo.png'
function Logo(props) {
  return (
    <div className='logo_common'>
      <img className='logo_img' src={LogoImg} alt='err' />
    </div>
  )
}

export default Logo
